import React from 'react';

import Card from 'react-bootstrap/Card'

  function HomeCard(props) {
    return (
      <Card>
        <Card.Img variant="top" src={props.photo} style={{ width: '10rem' }}/>
        <Card.Body>
          <Card.Title>Home</Card.Title>
          <Card.Text>
            {props.description}
          </Card.Text>
        </Card.Body>
      </Card>
    );
  }


export default HomeCard;
